import React from 'react';

const Login = () => {
    return (
        <div>
            <h2>התחברות</h2>
            <form>
                <div>
                    <label>אימייל:</label>
                    <input type="email" name="email" />
                </div>
                <div>
                    <label>סיסמה:</label>
                    <input type="password" name="password" />
                </div>
                <button type="submit">התחבר</button>
            </form>
        </div>
    );
};

export default Login;
